import { createClient } from 'redis';

const client = createClient({
    password: 'p7LS233UJKNl8F4eCSrb8OSWnluC9MLB',
    socket: {
        host: 'redis-19666.c16.us-east-1-3.ec2.redns.redis-cloud.com',
        port: 19666
    }
});

client.on('error', (err) => console.error(err));
client.connect();

export const random_numbers= async () => {
  const arr= await client.keys("*random*");
  return await Promise.all(arr.map((id)=>client.hGetAll(id)));
}
const arr=random_numbers();
export {arr};
